INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (186,'030','더운 본 3월 달에 힘이 떨어지고 역경이 밀어닥쳐 필시 결실을 보게 되겠습니다. 크게 가뭄 때에 단비를 맞닥뜨리니 어찌 기쁘지 않겠습니까. 구름이 흩어지고 달이 나오니 경치가 다시 새롭고 아름답습니다. 풀이 강가에 푸르게 자랐으니 성하고 부드러운 풀을 소가 마음껏 먹을 수 있게 되었습니다. 글쓴이의 운수는 반드시 경사가 있거나 식구를 늘려 기쁘게 될 것입니다. 만일 이와 같지 않으면 환희하거나 좋은 법을 사용하게 될 것입니다. 가를 물에 바람이 이니 여덟 소식을 몹자 소식을 즉하게 되겠습니다. 몸과 마음이 평안하니 백가지 일이 모두 길하겠습니다. 청풍을 입고 돌아오는 심신이 마치 새 풍을 갈아입은 것 같으니 이 또한 기쁨이 아니겠습니까?','심신이 화합하니 반드시 경사가 있고 위아래가 조화를 이루는 기쁨을 맛보겠습니다. 세상이 문에 비치니 필시 자신을 낮거나 식구를 늘리게 될 것입니다. 다른 사람들이 많이 도와주는데 어찌 재물이 생기지 않고 길함이 없겠습니까?','만일 봉사를 하지 못하면 반드시 재앙을 만날 것이니 미리 조심해야 합니다. 백 가지 일이 두루 순조롭게 진행되니 하루에도 현금을 얻어 실용하게 될 수 있습니다. 길한 가운데 돌아왔으니 몸도 굳하고 재물도 융성해지겠습니까?','바른 마음으로 일을 꾀하면 앞으로 나아갈 힘이 없이 형통해 질 것입니다. 만약 언쟁 쓰지 아니하면 복을 입을까 염려되니 환경을 바꾸거나 언쟁하면 길하게 됩니다. 만일 자신을 낮게 된다면 식구가 늘어나 경사가 있겠습니다.','동방에서 사람이 와 나를 도울 것이니 필시 일을 새로 시작하는데에서 길함이 있을 짐작입니다. 만가지 암여이 소멸되었으니 몸도 성하고 재물도 융성해집니다. 바깥이 여름을 지금처럼 가르치니 도리어 불리하게 됩니다. 쉬어서 쉬든 일을 바이려면 도리어 불리하게 됩니다.','재성이 문에 비치니 재물이 동방에서 융성하겠습니다. 일을 시작하기 전과 시작할 때를 잘 보십시오. 그러나 형되이 이동하게 되면 해로우니 차라리 새 일을 도모함이 좋겠습니다. 재물이 몸을 따랐 것이니 가히 큰 재물을 얻겠습니다.','산과 들에 봄이 돌아왔으니 빛이 더욱 새롭습니다. 마치 새천지를 만난 기분입니다. 만약 재물이 생기지 않더라도 신중에 경사가 있을 것이니 기쁨이 크겠습니다. 먼저는 희하고 뒤에는 길함을 만나게 될 것입니다.','구설수를 조심하십시오. 남의 일에 참어 들면 필시 구설이 있을 것입니다. 물과 불이 서로 상극하니 서로 다투는 것입니다. 아무런 이익이 없습니다. 마땅히 동쪽이나 서쪽으로 향하십시오. 일을 시작하고 마무리 짓는데서 이익을 얻게 될 것입니다.','만약 귀인이 와서 도움을 주게 된다면 재물도 생기고 몸도 융성해 질 것입니다. 명월이 높고 이름이 이롭게 되니 귀인이 와서 도와주게 될 것입니다. 맹사가 여의하여 말썽지 않고 형통하니 신상이 평안하고 집안이 태평하겠습니다.','작은 것이 가고 큰 것이 오니 반드시 가정을 새롭게 이루게 될 것입니다. 만약 다른 사람에게 힘을 얻게 되면 자수성가가 아닌 대성을 보겠습니다. 동시에 경영하는 일이 길하게 될 것이니 맹사가 형통해 질 것입니다.','시비를 버리게 되면 마치 석재수를 면한 어려움 것입니다. 남의 일에 참어 들지 마십시오. 만약 그렇지 아니하면 구설수를 면하기 어려울 것입니다. 마음이 상해 환자 곤란하는 것을 누가 알아주겠습니까. 영치 스스로를 위로하고 진심이 상책입니다.','해와 달이 항상 밝으니 기쁨이 가정 안에 가득 찰 것입니다. 만약에 이름을 날치지 않으면 반드시 재물을 얻을 것입니다. 집안이 화목하게 살어나가고 식구들이 융성하게 자라게 되니 이 모두가 기쁨을 나타냅니다.','시비를 가리이 하지 마십시오. 구설수가 몸에 친근하여 흘러나가기 힘들 것입니다. 조주가 여의하여 말썽지 않고 형통하니 신상이 평안하고 집안이 태평하겠습니다.','2025-03-02 03:02:01.144488+00','k');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (399,'030','在炎热的月份，力量将降低，逆境将被推动去看水果。您为什么不乐于在干旱期间面对Danbi？乌云散布着，月亮散发出来，风景又是新的美丽。由于草在河上长大绿色，所以母牛可以和母牛一样多吃。作家的运气会对斜坡感到满意或增加家庭。如果不是一样，您会很高兴或良好。风在水中，所以当我有八个新闻时，我会新闻。身心和平，所以一百件事会很长。这不是很高兴，因为在Cheongpung中回来的身心似乎改变了新风格？','由于身心很和谐，我们将很高兴地和往下协调。世界将在门口，因此您可能会增加您的家人。我该如何帮助他人，但没有财富？','如果您不服务，则必须遇到灾难，因此请提前小心。数以百计的事情顺利进行，因此您一天可以获得现金。您会回到漫长的过程中，您的身体会坚定而您的财富会被淹没吗？','如果您尝试以正确的思想工作，那么您将在没有前进的能力的情况下取得成功。如果您不使用争论，您将担心受到祝福。如果您很低，您的家人将增加并包括。','猜测人们会帮助我在东方的我和我，所以很长一段时间以来开始一项新作品。 10,000个癌症已被破坏，因此尸体持续了，财富被淹没了。像现在这样教夏天，它变得不利。如果您想休息一下，您将是不利的。','财富在门上，因此财富将在东方波动。在开始工作之前开始并开始。但是，如果您移动兄弟，最好是有害。财富遵循了身体，所以我将获得巨大的财富。','春天回到山上和田野，因此灯光更新。我觉得我遇到了一个新的Cheonji。如果没有财富，将会有很多快乐。首先，我们将遇到背面的悠久。','小心Gusulsu。如果您坚持他人的工作，将有一个描述。水和火是如此之高，以至于他们彼此争论。没有利润。请向东或向西行驶。您将从开始工作和完成工作中受益。','如果贵族到来并提供帮助，那么财富将筹集，身体将波动。 Myeongwol很高，名称是有益的，因此贵族会来并提供帮助。失明并没有烦恼，而且很繁荣，因此雕像将是和平的，家庭将是和平的。','小家伙会走，大个子肯定会成为一个新家庭。如果您要从他人那里获得力量，让我们看一下大道，而不是自我制作。同时，它将很长时间运行，因此盲人将是繁荣的。','如果您扔掉受精，很难避免seok jae -soo。不要站在别人的工作中。如果没有，很难逃脱。谁知道心脏因受伤而麻烦？最好安慰自己并安慰自己。','太阳和月亮总是明亮的，因此家庭将充满欢乐。如果您不命名，您一定会获得财富。所有这些都是喜悦，因为家庭和谐生活和家庭成长。','不要指向受精。 Gusul -Soo很难流动，因为它对身体很友好。由于Choju并没有困扰，因此它将越来越繁荣，因此雕像将是和平的，家庭将是和平的。','2025-03-02 03:02:01.144488+00','c');
INSERT INTO public.tojung (id,num,total,jan,feb,mar,apr,may,jun,jul,aug,sep,oct,nov,"dec",created_at,nation) VALUES (470,'030','暑い月には、強さが落ち、逆境が果物を見るために押されます。干ばつの間にダンビに直面して幸せになりませんか？雲が散らばっており、月が出てきて、景色は新しくて美しいです。草は川で緑に育ったので、牛は牛と同じくらい食べることができました。作家の運は、斜面に満足するか、家族を増やします。これが同じでない場合、あなたは楽しいか良いでしょう。風は水中にあるので、8つのニュースがあるときはニュースをします。身体と心は平和なので、百のものは長くなります。 Cheongpungに戻ってくる心と体が新しいスタイルを変えるように見えたので、これは喜びではありませんか？','心と体は調和がとれているので、私たちは上下に調和する喜びを持っています。世界はドアの上にあるので、あなたはあなたの家族を増やす可能性があります。どうすれば他の人を助けることができますが、富はありませんか？','あなたが奉仕しない場合は、災害に会う必要があるので、事前に注意してください。何百ものことがスムーズに動き回るので、1日で現金を得ることができます。あなたは長い道のりの真ん中に戻ってきますか、そしてあなたの体はしっかりし、あなたの富は浸水しますか？','あなたがあなたの正しい心で仕事をしようとするならば、あなたは前進する力なしに成功するでしょう。あなたが議論を使わないなら、あなたは祝福されることを心配するでしょう。あなたが低い場合、あなたの家族は増加し、含めます。','人々が私と東の私を助けてくれると推測されるので、新しい仕事を始めるのは長い間あります。 10,000がんが破壊されたため、体は持続し、富が浸水します。今のように夏を教えると、それは不利になります。休憩を取りたい場合は、不利になります。','富はドアにあるので、富は東で変動します。作業を開始する前に開始する前に。ただし、兄弟を動かすと、有害である方が良いです。富は身体に従っているので、私は大きな富を得るでしょう。','春は山と畑に戻っているので、光はより新しくなります。私は新しいCheonjiに会ったような気がします。富がなければ、多くの喜びがあります。まず、後ろの長さに会います。','Gusulsuに注意してください。他の人の仕事を保持すると、説明があります。水と火は非常に高く、彼らは互いに議論しています。利益はありません。東または西に向かってください。仕事を始めることと終了から恩恵を受けるでしょう。','貴族が来て助けてくれると、富は育ち、体は変動します。 Myeongwolは高く、名前は有益であるため、貴族が来て助けます。失明は困っておらず、繁栄しているので、像は平和になり、家族は平和になります。','小さなものが行き、大きなものは確かに新しい家族になります。他の人から強さを得ている場合は、自己メイドではなく、Daesungを見てみましょう。同時に、走るのは長いので、盲人は繁栄します。','受精を捨てると、ソク・ジェエを避けることは困難です。他人の仕事に立ってはいけません。そうでない場合は、逃げるのが難しいでしょう。心が怪我で困っていることを誰が知っていますか？自分自身を慰め、自分自身を慰めるのが最善です。','太陽と月はいつも明るいので、家族に喜びが満たされます。 만약에이름을이름을날치지반드시재물을얻을。 집안이화목하게화목하게살어나가고식구들이융성하게되니이기쁨을。','受精を指摘しないでください。 Gusul -soが体に友好的であるため、流れるのは難しいでしょう。チョジュは困っていないので、それはますます繁栄するので、像は平和になり、家族は平和になります。','2025-03-02 03:02:01.144488+00','j');
